// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./1_Storage.sol";

contract Bot {
    Storage public s;

    constructor(Storage addr){
        s = addr;
    }
    
    function storeWithCall(address _storage, uint256 x) public {
        (bool success, bytes memory data) = _storage.call(abi.encodeWithSelector(Storage.storeDelegateCall.selector, x));
        
    }

    function storeWithDelegateCall(address _storage, uint256 y) public {
        (bool success, bytes memory data) = _storage.delegatecall(abi.encodeWithSelector(Storage.storeDelegateCall.selector, y));
    }

    // function getVal() public view returns(uint256) {
    //     uint256 stored = s.retrieve();
    //     return stored;
    // }
}

